import { Container } from "react-bootstrap";

const TattooStyle = () => {


    return (
        <Container className="py-3">
            <div className="row">
                <div className="col">
                    <button>Blackwork</button>
                </div>
            </div>
        </Container>
    );
}

export default TattooStyle;
